import React, { useContext, useMemo } from "react";
import { useParams, useNavigate } from "react-router-dom";
import {
  Box,
  Typography,
  Card,
  CardContent,
  Button,
  List,
  ListItem,
  ListItemText,
  LinearProgress,
  Grid,
  Divider,
  Paper
} from "@mui/material";
import Navbar from "../components/Navbar";
import workshops from "../data/workshops";
import { UserContext } from "../contexts/UserContext";

export default function WorkshopDetailPage() {
  const { id } = useParams();
  const navigate = useNavigate();
  const workshop = workshops.find((w) => w.id.toString() === id);
  const { currentUser } = useContext(UserContext);

  if (!workshop) {
    return (
      <Box sx={{ p: 3 }}>
        <Typography variant="h6">Workshop not found</Typography>
      </Box>
    );
  }

  // Compute progress
  const progressInfo = useMemo(() => {
    const progressKey = `progress_${currentUser?.id}_${id}`;
    const data = JSON.parse(localStorage.getItem(progressKey) || "{}");
    let completedCount = 0;
    workshop.sections?.forEach((section) => {
      if (data[section.id]) completedCount += 1;
    });
    return {
      completedCount,
      total: workshop.sections?.length || 0,
      progressData: data,
    };
  }, [currentUser?.id, id, workshop.sections]);

  return (
    <Box sx={{ backgroundColor: "#f5f5f5", minHeight: "100vh" }}>
      <Navbar />
      <Box sx={{ p: 4, maxWidth: "1200px", mx: "auto" }}>
        {/* Header */}
        <Typography variant="h4" fontWeight="bold" gutterBottom>
          {workshop.title}
        </Typography>
        <Typography variant="subtitle1" color="text.secondary">
          Trainer: {workshop.trainerName}
        </Typography>

        <Grid container spacing={3} sx={{ mt: 2 }}>
          {/* Left Panel - Details */}
          <Grid item xs={12} md={8}>
            <Paper sx={{ p: 3, mb: 3 }}>
              <Typography variant="h6" gutterBottom>
                Description
              </Typography>
              <Typography variant="body1" sx={{ mb: 2 }}>
                {workshop.description}
              </Typography>

              <Typography variant="body2" color="text.secondary">
                Price: <strong>₹{workshop.price}</strong>
              </Typography>
            </Paper>

            <Paper sx={{ p: 3, mb: 3 }}>
              <Typography variant="h6" gutterBottom>
                Agenda
              </Typography>
              {workshop.agenda.split("\n").map((line, idx) => (
                <Typography key={idx} variant="body2">
                  • {line}
                </Typography>
              ))}
            </Paper>

            {/* Sections */}
            {workshop.sections && (
              <Paper sx={{ p: 3, mb: 3 }}>
                <Typography variant="h6" gutterBottom>
                  Sections Progress
                </Typography>
                <LinearProgress
                  variant="determinate"
                  value={
                    progressInfo.total
                      ? (progressInfo.completedCount / progressInfo.total) * 100
                      : 0
                  }
                  sx={{ mb: 1 }}
                />
                <Typography variant="caption" color="text.secondary">
                  {progressInfo.completedCount} of {progressInfo.total} sections
                  completed
                </Typography>
                <Divider sx={{ my: 2 }} />
                <List>
                  {workshop.sections.map((section) => {
                    const done = progressInfo.progressData[section.id];
                    return (
                      <ListItem
                        key={section.id}
                        sx={{
                          display: "flex",
                          justifyContent: "space-between",
                          alignItems: "center",
                        }}
                      >
                        <ListItemText
                          primary={section.title}
                          secondary={done ? "Completed" : "Not completed"}
                        />
                        <Button
                          variant={done ? "outlined" : "contained"}
                          onClick={() =>
                            navigate(`/workshops/${id}/sections/${section.id}`)
                          }
                        >
                          {done ? "Review" : "Start"}
                        </Button>
                      </ListItem>
                    );
                  })}
                </List>
              </Paper>
            )}
          </Grid>

          {/* Right Panel - Students & Actions */}
          <Grid item xs={12} md={4}>
            <Paper sx={{ p: 3, mb: 3 }}>
              <Typography variant="h6" gutterBottom>
                Enrolled Students
              </Typography>
              <List>
                {workshop.students.map((studentId) => (
                  <ListItem key={studentId}>
                    <ListItemText primary={`Student #${studentId}`} />
                  </ListItem>
                ))}
              </List>
            </Paper>

            <Paper sx={{ p: 3 }}>
              <Typography variant="h6" gutterBottom>
                Actions
              </Typography>
              <Box sx={{ display: "flex", flexDirection: "column", gap: 1 }}>
                <Button
                  variant="outlined"
                  onClick={() => navigate(`/workshops/${id}/quiz`)}
                >
                  Practice Quiz
                </Button>
                <Button
                  variant="outlined"
                  disabled={progressInfo.completedCount < progressInfo.total}
                  onClick={() => navigate(`/workshops/${id}/final-quiz`)}
                >
                  Certification Quiz
                </Button>
                <Button
                  variant="contained"
                  onClick={() => navigate(`/workshops/${id}/editor`)}
                >
                  Open Python Editor
                </Button>
                <Button
                  variant="outlined"
                  onClick={() => navigate(`/workshops/${id}/certificate`)}
                >
                  View Certificate
                </Button>
              </Box>
            </Paper>
          </Grid>
        </Grid>
      </Box>
    </Box>
  );
}
